ATTRIBUTE.VALUE:
-- set the HVST_SNAP_STAT_CD = complete UPDATE VRAP.TSNAP SET HVST_SNAP_STAT_CD = 3 WHERE SNAP_RUN_STAT_CD = 2;
-- For Accrual snapshots only where only the HVST snap is taken UPDATE VRAP.TSNAP SET SNAP_RUN_STAT_CD = 3 WHERE RUN_MODE_CD = 1 -- Accrual not BILLED AND SNAP_FREQ_CD = 1 -- MANUAL request AND SNAP_SEQ_NB > 0 -- PERMANENT SNAPS ONLY AND REQ_RUN_TS <= CURRENT TIMESTAMP + 15 MINUTE AND INV_SNAP_STAT_CD = 0 -- another qualifier for ACCRUAL AND RECN_SNAP_STAT_CD = 0 -- another qualifier for ACCRUAL AND SNAP_RUN_STAT_CD = 2; -- already running at this point
-- unlock the Allocation function -- this is the only function that is unlocked in the run until the end UPDATE VRAP.TSNAP_RVW_LOCK SET APPL_HVST_LOCK_CD = 0 , APPL_ULOCK_TS = current timestamp ,ULOCK_APPL_NM = 'wf_m_Snap_Hvst_Dtl' WHERE APPL_HVST_LOCK_CD = 1;
commit;

-- For Accrual snapshots, set running status UPDATE VRAP.TSNAP SET SNAP_RUN_STAT_CD = 2 -- set to running WHERE RUN_MODE_CD = 1 -- Accrual not BILLED AND SNAP_FREQ_CD = 1 -- MANUAL request AND SNAP_SEQ_NB > 0 AND REQ_RUN_TS <= CURRENT TIMESTAMP + 15 MINUTE AND INV_SNAP_STAT_CD = 0 AND RECN_SNAP_STAT_CD = 0 AND SNAP_RUN_STAT_CD = 1;
commit;
-- for Accrual and Billed UPDATE VRAP.TSNAP SET HVST_SNAP_STAT_CD = 2 WHERE SNAP_RUN_STAT_CD = 2;
commit;

UPDATE VRAP.TSNAP
SET HVST_SNAP_STAT_CD = 99
    ,SNAP_RUN_STAT_CD = 99
WHERE SNAP_RUN_STAT_CD = 2;

